1. **Define the function and its domain:**
   Given the function:
   \[
   f(x, y) = x \sqrt{1 - y^2} + y \sqrt{1 - x^2}
   \]
   where the domain is $-1 \leq x \leq 1$ and $-1 \leq y \leq 1$.

2. **Analyze the function at the boundaries:**
   - When $x = -1$, we have:
     \[
     f(-1, y) = -1 \cdot \sqrt{1 - y^2} + y \cdot \sqrt{1 - (-1)^2} = -\sqrt{1 - y^2} + y \cdot 0 = -\sqrt{1 - y^2}
     \]
   - When $x = 1$, we have:
     \[
     f(1, y) = 1 \cdot \sqrt{1 - y^2} + y \cdot \sqrt{1 - 1^2} = \sqrt{1 - y^2} + y \cdot 0 = \sqrt{1 - y^2}
     \]
    - When $y = -1$, we have:
     \[
     f(x, -1) = x \cdot \sqrt{1 - (-1)^2} + (-1) \cdot \sqrt{1 - x^2} = x \cdot 0 - \sqrt{1 - x^2} = -\sqrt{1 - x^2}
     \]
   - When $y = 1$, we have:
     \[
     f(x, 1) = x \cdot \sqrt{1 - 1^2} + 1 \cdot \sqrt{1 - x^2} = x \cdot 0 + \sqrt{1 - x^2} = \sqrt{1 - x^2}
     \]

3. **Determine the maximum value:**
   - From the boundary analysis, we see that the function values at these boundaries are either $\sqrt{1 - y^2}$ or $-\sqrt{1 - x^2}$.
   - The maximum value of $\sqrt{1 - y^2}$ is when $y = 0$, giving:
     \[
     \sqrt{1 - 0^2} = 1
     \]
   -  Therefore, the maximum value of $f(x, y)$ is 1.

4. **Conclusion:**
   - The maximum value of the function $f(x, y) = x \sqrt{1 - y^2} + y \sqrt{1 - x^2}$ within the given domain is 1.

